import React, { useState,useEffect, useMemo } from "react";
import { Menu,notification,Input,Button, List, Avatar ,Select,Table, Divider, Tag  } from 'antd';
import { Link, useNavigate, useLocation } from "react-router-dom";
import '../style.css';
import Header from '../commpont/Header';
import Footer from '../commpont/Footer';


function Movie() {
  const { SubMenu } = Menu;
  const navigate = useNavigate();
  const [searchText,setSearchText]=useState("");
  const [year,setYear]=useState("");
  const { Option } = Select;
  const [yearList,setYearList]=useState(["any year",1990,1991,1992,1993,1994,1995,1996,1997,1998,1999,2000,2001,2002,2003,2004,2005,2006,2007,2008,2009,2010,2011,2012,2013,2014,2015,2016,2017,2018,2019,2020,2021,2022,2023]);
  const [movieList,setMovieList]=useState({});
  // useEffect(()=>{
  //   for(var i=1990;i<=2023;i++){
  //     var now_yearList=yearList;
  //     now_yearList.push(i);
  //     setYearList(now_yearList);
  //   }
  // },[yearList]);

  

  const openNotificationWithIcon = (type,title,text) => {
    notification[type]({
      message: title,
      description:text,
    });
  };

  let search = e => {
    if(searchText!=""){
      var query="?title="+searchText;
      if(year!="" && year!="any year"){
         query+="&year="+year;
      }

      $.ajax({
        type:"get",
        url:"http://sefdb02.qut.edu.au:3000/movies/search"+query,
        success:function(data){
          openNotificationWithIcon('success','Search Tips',"Search Successfully");
          setMovieList(data);
          //console.log(data);
        },
        error:function(data){
          openNotificationWithIcon('error','Error',"Unknown error occurred");
        }
      });

    }else{
      openNotificationWithIcon("error","Searcg Tips","The search content cannot be empty!");
    }
  }


  function handleChange(value) {
    setYear(value);
  }

  function tableChange(e){
    var now_movie_length=movieList.data.length;
    var now_current_length=e.current*e.pageSize;
    if(now_current_length==now_movie_length && movieList.pagination.currentPage!=movieList.pagination.lastPage){
      var query="?title="+searchText+"&page="+ movieList.pagination.nextPage;
      if(year!="" && year!="any year"){
         query+="&year="+year;
      }
      $.ajax({
        type:"get",
        url:"http://sefdb02.qut.edu.au:3000/movies/search"+query,
        success:function(data){
          var now_movieList=movieList;
          data.data.forEach(element => {
            now_movieList.data.push(element);
          });
          now_movieList.pagination=data.pagination;
          setMovieList([]);
          setMovieList(now_movieList);
        },
        error:function(data){
          openNotificationWithIcon('error','Error',"Unknown error occurred");
        }
      });
    }
  } 
  
  const openDetail = e => {
    console.log(e.target.name);
    navigate("/details?imdbId="+e.target.name);
  }

  const columns = [
    {
      title: 'Title',
      dataIndex: 'title',
      key: 'imdbID',
      render: (text,key) => <a onClick={openDetail} name={key.imdbID}>{text}</a>,
    },
    {
      title: 'Year',
      dataIndex: 'year',
      key: 'year',
    },
    {
      title: 'IMDB Rating',
      dataIndex: 'imdbRating',
      key: 'imdbRating',
    },
    {
      title: 'Rotten Tomatoes',
      dataIndex: 'rottenTomatoesRating',
      key: 'rottenTomatoesRating',
    },
    {
      title: 'Metacritic',
      dataIndex: 'metacriticRating',
      key: 'metacriticRating',
    },
    {
      title: 'Rated',
      dataIndex: 'classification',
      key: 'classification',
    },
  ];
  

  return (
    <div>
      <Header/>
      <div className="movie_box">
        <div className="search_box">
          <label>Movies containing the text:</label>
          <Input className="input_search" onChange={e=>setSearchText(e.target.value)}/>
          <label>form</label>
          <Select defaultValue="any year" style={{ width: 100 }} onChange={handleChange}>
           {yearList.map(year=>(
              <Option value={year}>
                {year}
              </Option>
            ))} 
          </Select>
          <Button className="button_search" onClick={search} >Search</Button>
        </div>

        <div>
          <Table columns={columns} dataSource={movieList.data} onChange={tableChange}  rowKey={record => record.imdbID}/>
        </div>
      </div>
      <Footer/>
    </div>
  );
}

export default Movie;
